<template>
    <StackLayout backgroundColor="white">
        <Label v-if="!addMap" class="titreModal h2 text-center" :text="LblText" />
        <TextView editable="false" v-if="addMap" class="titreModal h2 text-center" text="Centrez la carte au bon endroit puis validez" />
        <Mapbox height="70%" v-if="addMap" accessToken="pk.eyJ1IjoiaHByb3V4MDQiLCJhIjoiY2s3eDdqejg3MDkzZzNqczg2NW1kaHVibCJ9.3mKpF4JL0zVFgRGl9wIsqA"
                mapStyle="streets"
                showUserLocation="true"
                disableZoom="false"
                disableRotation="true"
                disableScroll="false"
                disableTilt="false"
                ref="map"
                @mapReady="onMapReady($event)">
        </Mapbox>
        <ListView v-if="!addMap" separatorColor="black" width="100%" height="60%" class="listView" for="map in listOfMaps" @itemTap="listMapTap">
            <v-template>
                <StackLayout>
                    <Label class="h3 text-center" :text="map.ville" />
                    <Image :src="map.miniature"/>
                </StackLayout>
            </v-template>
        </ListView>
        <Button v-if="!addMap" class="btn btn-outline" text="Ajouter une nouvelle carte" @tap="addMapBtn"/>
        <Button v-if="addMap" class="btn btn-outline" text="Valider la zone" @tap="validateZone"/>

    </StackLayout>
</template>

<script>
    const LoadingIndicator = require('@nstudio/nativescript-loading-indicator').LoadingIndicator;
    const Mode = require('@nstudio/nativescript-loading-indicator').Mode;
    const loader = new LoadingIndicator();
    const options = {
        message: "Ajout de la carte",
        details: 'Veuillez patienter...'
    };

    export default {
        props: ['ville'],
        created(){
            this.LblText = "SÃ©lectionnez une carte";
            this.addMap = false;
            loader.show();
            this.$axios.get(this.$store.state.urlApi+"/app/api/index.php/maps").then((result) => {
                //console.log(result.data);
                this.listOfMaps = result.data.maps;
                loader.hide();
            }).catch((err) => {
                loader.hide();
                alert("Une erreur est survenue");
                console.log(err);
            })
        },
        data() {
            return {
                addMap : null,
                listOfMaps : null,
                LblText : null,
                map : null,
                zoomLevel : null,
                lat : null,
                lng : null,
            };
        },
        methods:{
            listMapTap(map){
                this.$store.commit("changeStateIsThereMap");
                this.$store.commit("setMapDetails", map.item);
                this.$modal.close();
            },
            onMapReady(args){
                this.map = args.map;
            },
            addMapBtn(){
                this.LblText = "Choix d'une zone";
                this.addMap = true;
          },
            validateZone(){
                let that = this;
                this.map.getCenter().then(
                    function(result) {
                        that.lat = result.lat;
                        that.lng = result.lng;
                        that.map.getZoomLevel().then(
                            function(result) {
                                that.zoomLevel = result.toFixed(0);
                                that.miniature = "";
                                that.$axios.post(that.$store.state.urlApi + "/app/api/index.php/maps", {
                                    lat: that.lat,
                                    lng: that.lng,
                                    zoom: that.zoomLevel,
                                    ville: that.ville,
                                    miniature: that.miniature,
                                }).then((result) => {
                                    that.$store.commit("changeStateIsThereMap");
                                    that.$store.commit("setMapDetails", result.data);
                                    that.$modal.close();
                                    alert("Carte ajoutÃ©e avec succÃ¨s");
                                }).catch((err) => {
                                    console.log(err.response.request._response);
                                    alert("Une erreur est survenue");
                                })

                            },
                            function(error) {
                                console.log("mapbox getZoomLevel error: " + error);
                                alert("Une erreur est survenue");
                                return;
                            }
                        )
                    },
                    function(error) {
                        console.log("mapbox getCenter error: " + error);
                        console.log(3);
                        alert("Une erreur est survenue");
                        return;
                    }
                )
            },
        },
    };
</script>

<style lang="scss" scoped>

    .titreModal{
        margin-top:2%;
    }

    .TextField {
        color: black;
        placeholder-color:black;
        width: 80%;
        font-size: 15em;
    }
</style>
